async ({
  template,
  params,
  render,
  db,
  req,
  reply,
  user,
  log,
  ext,
  isDev,
}: Server) => {
  const deletedata = async (iddata) => {
    const data = await db.alamat_Departemen.delete({
      where: {
        id: Number(iddata),
      },
    });
    reply.send({
      data: data,
      status: "success deleted",
    });
  };
  deletedata(params.id)
}
